    false,nt"url": null,nt"notes": "An estimated 70,000 acre feet (AF) of water
    are needed annually to maintain  14,000 acres of marsh currently regulated by Operating
    Criteria and Procedures (OCAP) on the Stillwater Wildlife Management Area (SWMA).
    These estimates of water requirements were made in order to provide an intelligent
    basis for management and planning of water developments on SWMA. The 1990 water
    projections forecast a 70% irrigation delivery year. This equates to approximately
    20-23,000 AF to maintain 4-5,000 acres at SWMA based on projected water storage
    at Lahontan Reservoir.",nt"license_title": "License Not Specified",nt"extras":
